// 1041434393127-fan5i6k5bipfq5nafoffffs2smi1aoju.apps.googleusercontent.com
import React from 'react';
import { Router, Route, Switch } from "react-router-dom";
import MailCreate from './mails/MailCreate';
import MailEdit from './mails/MailEdit';
import MailList from './mails/MailList';
import MailDelete from './mails/MailDelete';
import MailShow from './mails/MailShow';
import Header from './Header';
import history from '../history';

const App = () => {
  return (
    <div className="ui container">
      <Router history={history}>
        <Header />
        <Switch>
          <Route path="/" exact={true} component={MailList} />
          <Route path="/mails/new" component={MailCreate} />
          <Route path="/mails/edit/:id" component={MailEdit} />
          <Route path="/mails/:id" component={MailShow} />
        </Switch>
      </Router>
    </div>
  );
};

export default App;
